import React from "react";
import styled from "styled-components";
import userAccount from "../../img/icons/user.png"
import requests from "../../img/icons/pedido.png"
import address from "../../img/icons/pointer.png"
import gear from "../../img/icons/engrenagem.png"
import { useNavigate } from "react-router-dom";

export default function BoxInfoAccount() {

    const navigate = useNavigate()

    return (
      <StyledBoxInfoAccount>
        <div className="myaccount">
          <img src={userAccount} />
          Minha conta
        </div>
        <div className="myaccount">
          <img src={requests} />
          Meus pedidos
        </div>
        <div className="myaccount">
          <img src={address} />
          Endere√ßos Cadastrados
        </div>
        <div className="myaccount">
          <img src={gear} />
          Meus dados
        </div>
      </StyledBoxInfoAccount>
    );
}

const StyledBoxInfoAccount = styled.div`
  width: 290px;
  background-color: #515151;
  border

  .myaccount {
    height: 65px;
    border-bottom: 1px solid #808080;
    display: flex;
    justify-content: flex-start;
    align-items: center;
    cursor: pointer;
    padding: 0 20px;

    font-size: 16px;
    color: white;
  }

  .myaccount:hover {
    background-color: #5f5f5f;
  }

  .myaccount img {
    width: 28px;
    border-radius: 5px;
    margin-right: 10px;
  }
`;

